import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Budgitizer 1.0</h3>
        <div className="row">
          <div className="col-sm">one</div>
          <div className="col-sm">two</div>
          <div className="col-sm">three</div>
        </div>
      </header>
    </div>
  );
}

export default App;
